import React, { useState } from 'react';
import { FaPhoneAlt, FaFireExtinguisher, FaExclamationTriangle, FaSearch } from 'react-icons/fa';

const contacts = [
  {
    name: 'NDRF (National Disaster Response Force)',
    phone: '011-12345678',
    icon: 'exclamation-triangle',
    type: 'Disaster Response',
  },
  {
    name: 'Fire Department',
    phone: '101',
    icon: 'fire-extinguisher',
    type: 'Fire Emergency',
  },
  {
    name: 'State Disaster Management Authorities (SDMAs)',
    phone: '011-87654321',
    icon: 'phone-alt',
    type: 'Disaster Management',
  },
];

const disasterDetails = [
  {
    title: 'Earthquake',
    description:
      'An earthquake is the shaking of the surface of the Earth resulting from a sudden release of energy in the Earth\'s lithosphere that creates seismic waves. Stay indoors, take cover under sturdy furniture, and avoid windows.',
  },
  {
    title: 'Flood',
    description:
      'Floods are an overflow of water that submerges land that is usually dry. Move to higher ground immediately, avoid walking or driving through floodwaters, and listen to emergency alerts.',
  },
  {
    title: 'Cyclone',
    description:
      'A cyclone is a large scale air mass that rotates around a strong center of low atmospheric pressure. Secure your home, stay indoors away from windows, and follow evacuation orders if given.',
  },
];

const EmergencyContact = () => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleCall = (phone) => {
    window.location.href = `tel:${phone}`;
  };

  const handleSMS = (phone) => {
    window.location.href = `sms:${phone}`;
  };

  const filteredContacts = contacts.filter(
    (contact) =>
      contact.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      contact.type.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="p-6 bg-white rounded-lg shadow-lg max-w-5xl mx-auto my-8">
      <header className="mb-6 text-center">
        <h2 className="text-3xl font-extrabold mb-2">ðŸ†˜ Emergency Contact & Natural Disaster Info</h2>
        <p className="text-gray-700 max-w-2xl mx-auto">
          Quickly access important emergency contacts and learn essential information about common natural disasters to stay prepared.
        </p>
      </header>

      <div className="mb-6">
        <div className="relative max-w-md mx-auto">
          <input
            type="text"
            placeholder="Search contacts..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full border border-gray-300 rounded pl-10 pr-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          <FaSearch className="absolute left-3 top-2.5 text-gray-400" />
        </div>
      </div>

      <ul className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-8">
        {filteredContacts.length > 0 ? (
          filteredContacts.map((contact) => (
            <li
              key={contact.phone}
              className="flex items-center justify-between p-4 border border-gray-200 rounded-lg shadow-sm hover:shadow-md transition-shadow bg-gray-50"
            >
              <div className="flex items-center gap-4">
                <div className="text-3xl">{contact.icon}</div>
                <div>
                  <p className="font-semibold text-lg">{contact.name}</p>
                  <p className="text-gray-600">{contact.phone}</p>
                  <p className="text-sm text-gray-500">{contact.type}</p>
                </div>
              </div>
              <div className="flex gap-3">
                <button
                  onClick={() => handleCall(contact.phone)}
                  className="bg-red-600 hover:bg-red-700 text-white py-1 px-4 rounded transition"
                >
                  Call Now
                </button>
                <button
                  onClick={() => handleSMS(contact.phone)}
                  className="bg-yellow-500 hover:bg-yellow-600 text-white py-1 px-4 rounded transition"
                >
                  Send SMS
                </button>
              </div>
            </li>
          ))
        ) : (
          <p className="col-span-full text-center text-gray-500">No contacts found.</p>
        )}
      </ul>

      <section>
        <h3 className="text-2xl font-bold mb-4">Natural Disaster Information & Safety Tips</h3>
        <div className="space-y-6">
          {disasterDetails.map((disaster) => (
            <div
              key={disaster.title}
              className="p-4 border border-gray-300 rounded-lg bg-white shadow-sm hover:shadow-md transition-shadow"
            >
              <h4 className="text-xl font-semibold mb-2">{disaster.title}</h4>
              <p className="text-gray-700">{disaster.description}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default EmergencyContact;
